  \"2016-07-27T22:41:53.598695\",\n\t\"name\": \"contaminants-in-interior-least-tern-eggs-from-quivira-national-wildlife-refuge-kansas-in-1\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Flooded or abandoned eggs of interior least
  terns (Sterna antillarum) nesting at Quivira National Wildlife Refuge in central
  Kansas were collected in 1990 and 1991. Four eggs were analyzed for metals and organochlorine
  contaminants in 1990. Two eggs were analyzed for metals in 1991. Concentrations
  of all metals analyzed were below the levels at which harmful effects on hatchability
  or survival are likely to occur. The only organochlorine compound detected in the
  eggs from 1990 was p,p'-DDE. The very low concentrations detected were unlikely
  to have caused any observable effects on productivity. The stage of incubation of
  the eggs collected was variable, and no conclusions relating contaminant levels
  to incubation stage should be drawn from the analyses. The information from the
  limited number of eggs analyzed indicates that there are no contaminants problems
  for interior least terns nesting at the refuge.\",\n\t\"license_title\": \"License
